import React from 'react'
import {Cover} from './../../img/Cover1.jpg'
import {Profile} from './../../img/Profile1.jpg'

const ProfileCard = () => {
  return (
    <div className="ProfileCard">
        <img src={Cover} alt="" />
        <img src={Profile} alt=''/>
    </div>
  )
}

export default ProfileCard
